import slide1 from './slide1.jpg';
import slide2 from './slide2.jpg';
import slide3 from './slide3.png';
import slide4 from './slide4.jpg';
import slide5 from './slide5.jpg';

export const Data = () => {
    return {
        slide1 : slide1,
        slide2 : slide2,
        slide3 : slide3,
        slide4 : slide4,
        slide5 : slide5,
    }
};
